import React, { useState, useEffect } from "react";

const Home = () => {
    const [lakes, setLakes] = useState([]);
    useEffect(() => {
        fetch("https://jasonserverhoustonfishing.herokuapp.com/lakes")
            .then(res => res.json())
            .then(rsp => {
                setLakes(rsp)
                
            },[lakes]);
    });
    return (
        <div>
            {lakes.map((lake,)=>{
                return <h3>{lake.name}</h3>
            })}

        </div>
    );
};
export default Home;
